// tabelaCars.js
import React from 'react';
import CarNoButtons from '../CarNoButtons';
function TabelaCars({ filterType, filterName, handleFilterTypeChange, handleFilterNameChange, carsFiltered }) {
    // Your component logic here, and use the carsFiltered prop where needed
  
  
  return (
    <div>
      <div className="row">
        <h2 className="text-uppercase" style={{ paddingTop: '25px', paddingBottom: '10px' }}>
          Filtriraj podatke :
        </h2>
        <div className="col-6 md" style={{ paddingTop: '5px' }}>
          <select
            className="form-control"
            name="type"
            value={filterName}
            onChange={handleFilterNameChange}
          >
            {/* ... (your existing code) */}
          </select>
        </div>
        <div className="col-6 md" style={{ paddingTop: '5px' }}>
          <select
            className="form-control"
            name="type"
            value={filterType}
            onChange={handleFilterTypeChange}
          >
            {/* ... (your existing code) */}
          </select>
        </div>
      </div>

      <table className="table table-striped">
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Tip</th>
           
          </tr>
        </thead>
        <tbody>
          {carsFiltered.map((car, index) => (
                     <CarNoButtons key={index} car={car} />

          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TabelaCars;
